import React from 'react';

export function HeaderMessage() {
  return (
    <div className="header-message">
      <p>Paul</p><p>&</p><p>Elyse</p>
    </div>
  );
}

export function FooterMessage() {
  return (
    <div className="footer-message">
      <p className="contact">Having trouble signining in? Contact Us at <i>paulandelysewedding@gmail.com</i></p>
      <p className="photocredit">Photo Credit: Brittany Fleming - Facebook: @bflemingphoto Instagram: @bflemingphotography</p>
    </div>
  );
}

export function Button(props) {

  if (props.type === "submit") {
    return (
      <button className="submitButton"
        type="submit"
        disabled={props.disabled}>
        {props.text}
      </button>
    )
  } else {
    return (
      <button className="button"
        onClick={props.clickAction}>
        {props.text}
      </button>
    )
  }

}
